$_MODULE['<{ets_contactform7}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Контактные формы';
$_MODULE['<{ets_contactform7}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Чтобы добавить поле ввода reCAPTCHA, вам необходимо сначала включить reCAPTCHA. Перейдите к [1]«Настройки > Интеграция > reCAPTCHA»[/1], включите параметр reCAPTCHA и введите пару ключей.';
$_MODULE['<{ets_contactform7}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Чтобы узнать, как получить ключ сайта reCAPTCHA и секретный ключ, ознакомьтесь с документацией нашего модуля.';
$_MODULE['<{ets_contactform7}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Чтобы иметь возможность отвечать на сообщения клиентов непосредственно в бэк-офисе, вам нужен адрес электронной почты вашего клиента. При создании контактной формы обязательно добавьте поле ввода электронной почты и отметьте его как обязательное поле.';
$_MODULE['<{ets_contactform7}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Конфигурации электронной почты';
$_MODULE['<{ets_contactform7}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Чтобы получить информацию из контактной формы в электронное письмо, отправленное на адрес электронной почты администратора или автоответчика, скопируйте и вставьте соответствующие почтовые теги в поле [1]«Тело сообщения»[/1] в [1]«Контактные формы > Почта».[/1] вложенная вкладка';
$_MODULE['<{ets_contactform7}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Чтобы получить вложенный файл от вашего клиента по электронной почте, перейдите в [1]«Контактные формы > Почта»[/1] и установите флажок [1]«Вложение файла»[/1].';
$_MODULE['<{ets_contactform7}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Чтобы получить вложенный файл от вашего клиента через вкладку «Сообщения», перейдите в [1]«Контактные формы > Настройки»[/1] и включите опцию [1]«Сохранить вложения»[/1].';
